/*login.jsx*/
import React from "react";
import GoogleLogin from "react-google-login";
// npm install react-google-login

//You have to use the link component to link between you pages
import { Link } from "react-router-dom";
import { Button } from "react-bootstrap";
//$ npm install --save react react-dom
//$ npm install --save react-bootstrap

//Functional Component
const LoginPage = () => {
  responseGoogleSuccess = (response) => {
    console.log(response);
    console.log(response.profileObj);
    document.write("Welcome to Meeting Ground\nLogin Successfulla");
  };
  responseGoogleFailure = (response) => {
    console.log(response);
    console.log(response.profileObj);
    document.write("Not able to join to Meeting Ground\nLogin failed");
  };
  return (
    <div>
      <img id="logo" src="./img/meetingGroundLogo.png" />
      <h3>Welcome to the React Router Tutorial</h3>
      <small>Main Page</small>
      <Link to="/home">
        <Button renderAs="button">
          <span>Login</span>
        </Button>

        <GoogleLogin
          clientId="272589905349-scqfilok0ucok40j6h6eo9pcsp7bhadd.apps.googleusercontent.com"
          buttonText="Login"
          onSuccess={responseGoogleSuccess}
          onFailure={responseGoogleFailure}
          cookiePolicy={"single_host_origin"}
        />
      </Link>
    </div>
  );
};

export default LoginPage;
